import React from 'react';
import './Skills.css';

const Skills = () => {
  const technicalSkills = [
    { name: 'React', icon: '⚛️' },
    { name: 'JavaScript', icon: '🟨' },
    { name: 'TypeScript', icon: '🟦' },
    { name: 'Node.js', icon: '🟩' },
    { name: 'Firebase', icon: '🔥' },
    { name: 'MongoDB', icon: '🍃' }
  ];

  const professionalSkills = [
    { name: 'Trabajo en equipo', icon: '👥' },
    { name: 'Comunicación', icon: '💬' },
    { name: 'Resolución de problemas', icon: '🔧' },
    { name: 'Gestión del tiempo', icon: '⏱️' },
    { name: 'Adaptabilidad', icon: '🔄' },
    { name: 'Liderazgo', icon: '🌟' }
  ];

  return (
    <section id="skills" className="skills-section">
      <div className="skills-container">
        <h2 className="section-title">Habilidades Técnicas</h2>
        <div className="skills-grid">
          {technicalSkills.map((skill, index) => (
            <div className="skill-card" key={index}>
              <span className="skill-icon">{skill.icon}</span>
              <span className="skill-name">{skill.name}</span>
            </div>
          ))}
        </div>

        <h2 className="section-title">Habilidades Profesionales</h2>
        <div className="professional-skills">
          {professionalSkills.map((skill, index) => (
            <div className="professional-skill" key={index}>
              <span className="skill-icon">{skill.icon}</span>
              <span className="skill-name">{skill.name}</span>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
